算子插件开发
原理介绍
在开发算子插件时，支持以下两种方式。

非IR（intermediate representation，中介码）方式

自定义类（如：ReductionParser类），继承CaffeTVMOpParser基类，重写ParseParams、ParseWeights函数，实现caffe模型与自定义模型中算子参数、权值参数的映射。
自定义类（如：ReductionBuilder类），继承TVMOpBuilder基类，重写GetOutputDesc函数（获取算子的输出描述）、BuildTvmBinFile函数（构建算子的二进制文件）。
调用DOMI_REGISTER_OP完成算子注册。
图 1  算子插件开发原理图



IR方式

自定义类（如：CustomOperator类），继承Operator类，调用Attr函数（将属性值写入到离线模型）、重写ParseParams函数（完成caffe模型参数和权值的转换，将结果填到中自定义类中）。
自定义类（如：caffe_reduction_layerOpBuilder类），继承TVMOpBuilder基类，重写GetOutputDesc函数（获取算子的输出描述）、BuildTvmBinFile函数（构建算子的二进制文件）。
调用DOMI_OP_SCHEMA注册算子参数规格，调用DOMI_REGISTER_CAFFE_PARSER注册算子解析函数，调用DOMI_REGISTER_OP完成算子注册。



